import React from "react";
import Link from "next/link";
import AppLayout from "../components/AppLayout";

//메인화면
const Home = () => {
  return (
    <>
      <AppLayout>
        <Link href="/about">
          <a>about</a>
        </Link>
        <div>Hello, Next!</div>
      </AppLayout>
    </>
  );
};

export default Home;
